CREATE TABLE OperacaoAgricola (
  ID                         number(10) GENERATED AS IDENTITY, 
  TipoOperacaoTipo           varchar2(255) NOT NULL, 
  CadernoCampoID             number(10), 
  DataRealizacao             date NOT NULL, 
  Quantidade                 number(10), 
  Unidadedesignacao          varchar2(10), 
  FatorProducaoNomeComercial varchar2(255), 
  Parcela                    varchar2(255) NOT NULL, 
  Cultura                    varchar2(255) NOT NULL, 
  PRIMARY KEY (ID));


SELECT 
    parcela AS "Nome da Parcela",
    cultura AS "Nome da Cultura",
    SUM(Quantidade) AS "Quantidade Colhida"
FROM 
    operacaoagricola
WHERE
    datarealizacao BETWEEN '01-Jan-2017' AND '30-Dec-2023'
    AND parcela = 'Campo grande'
    AND tipooperacaotipo='Colheita' 
GROUP BY
    parcela,
    cultura;

